import Vue from "vue";
import Vuex from "vuex";

Vue.use(Vuex);

export default new Vuex.Store({
  state: {
    token: sessionStorage.getItem("token") || '',
    name: sessionStorage.getItem("token") || '',
    avatar: sessionStorage.getItem("token") || '',
    roles: [],
  },
  getters: {},
  mutations: {
    setToken(state, data) {
      state.token = data;
      console.log("vue中的token ", data)
      sessionStorage.setItem("token", data);
    },
    setName(state, data) {
      state.token = data;
      console.log("vue中的token ", data)
      sessionStorage.setItem("token", data);
    },
    setAvatar(state, data) {
      state.token = data;
      console.log("vue中的token ", data)
      sessionStorage.setItem("token", data);
    },
    setRoles(state, data) {
      state.token = data;
      console.log("vue中的token ", data)
      sessionStorage.setItem("token", data);
    },
  },
  actions: {},
  modules: {},
});
